    "2013-03-15T14:32:22.188056",nt"name": "elevationdem-lkchdem",nt"isopen":
    false,nt"url": null,nt"notes": "The ElevationDEM_LKCHDEM data layer includes
    bathymetric data derived NOAA nautical charts. All points were digitized from the
    RF 40,000 scale NOAA charts for Lake Champlain. The original data released in 1992
    did not include information from Mallets Bay north and from the Crown Point bridge
    south. VCGI added data for these missing areas in 2003 by taking points from the
    LCBP data bundle (LAKEBATH). VCGI also replaced the shoreline points in 2010 using
    the shoreline as defined in the VHDCARTO dataset.",nt"license_title": null,nt"extras":
